import React, { useState, useCallback, useEffect } from "react";

import {
  getAllVereine as dbGetAllVereine,
  deleteVerein as dbDeleteVerein,
  createVerein as dbCreateVerein,
  replaceVerein as dbReplaceVerein,
} from "../../services/vereine";

import { MenueHeader } from "../MenueHeader";

import { VereinTable } from "./VereinTable";
import { VereinViewForm } from "./VereinViewForm";
import { VereinEditForm } from "./VereinEditForm";

const Vereine = () => {
  // vereinFormModus: V = ViewMode, E = EditMode
  const [vereinFormEditMode, setVereinFormEditMode] = useState(false);

  const [verein, setVerein] = useState<any | null>([]);
  const [vereine, setVereine] = useState<any | null>([]);
  const [loading, setLoading] = useState<boolean | null>(false);
  const [vereinId, setVereinId] = useState<any | null>(0);

  const [btnLöschenIsDisabled, setBtnLöschenIsDisabled] = useState(true);
  const [btnNeuerVereinIsDisabled, setBtnNeuerVereinIsDisabled] =
    useState(false);
  const [btnÄndernIsDisabled, setBtnÄndernIsDisabled] = useState(true);
  const [modusNeuerVerein, setModusNeuerVerein] = useState(true);

  const onRowSelect = useCallback((event) => {
    setVereinFormEditMode(false);
    setBtnLöschenIsDisabled(false);
    setBtnÄndernIsDisabled(false);
    setVereinId(event.data.id);
    setVerein(vereine.filter((vereine) => vereine.id === event.data.id));
  });

  const editVerein = useCallback(() => {
    setBtnLöschenIsDisabled(true);
    setVereinFormEditMode(true);
    setBtnÄndernIsDisabled(true);
    setModusNeuerVerein(false);
  });

  const deleteVerein = useCallback(() => {
    setBtnLöschenIsDisabled(true);
    setBtnÄndernIsDisabled(true);
    dbDeleteVerein(vereinId);
    setLoading(!loading);
  });

  const btnAbbruch = useCallback(() => {
    setBtnLöschenIsDisabled(true);
    setVereinFormEditMode(false);
    initVerein(setVerein);
  });

  const btnNeuerVerein = useCallback(() => {
    // Felder leeren und auf Input umschalten
    setModusNeuerVerein(true);
    setBtnLöschenIsDisabled(true);
    setBtnÄndernIsDisabled(true);
    setBtnNeuerVereinIsDisabled(false);
    setVereinFormEditMode(true);

    initVerein(setVerein);
  });

  const btnSpeichern = useCallback((verein) => {
    setBtnLöschenIsDisabled(true);
    setBtnÄndernIsDisabled(true);

    if (modusNeuerVerein) {
      dbCreateVerein(verein);
    } else {
      verein.id = vereinId;
      dbReplaceVerein(verein);
    }
    setVereinFormEditMode(false);
    setLoading(!loading);
  });

  const btnStartMenue = useCallback(() => {
    // prüfen, ob die Daten plausibel sind (also nicht leer, Änderung gegenüber den vorherigen, ...)
    window.location.href = "/startmenue";
  });

  useEffect(() => {
    dbGetAllVereine().then((vereine) => {
      setVereine(vereine);
    });
    initVerein(setVerein);
  }, [loading]);

  useEffect(() => {}, [verein]);

  const vereinAnz = vereine.length; // Anzahl der Vereine

  return (
    <>
      <MenueHeader headerText={vereinAnz + " Vereine"} />
      <VereinTable
        selectedVerein={vereinId}
        vereine={vereine}
        onRowSelect={onRowSelect}
      />
      <br />
      <div>
        {vereinFormEditMode ? (
          <VereinEditForm
            modusNeuerVerein={modusNeuerVerein}
            onSpeichern={btnSpeichern}
            onAbbruch={btnAbbruch}
            verein={verein}
          />
        ) : (
          <VereinViewForm
            onNeuerVerein={btnNeuerVerein}
            btnNeuerVerein={btnNeuerVereinIsDisabled}
            onÄndernVerein={editVerein}
            btnÄndernVerein={btnÄndernIsDisabled}
            onDeleteVerein={deleteVerein}
            btnLöschenVerein={btnLöschenIsDisabled}
            onStartMenue={btnStartMenue}
            verein={verein}
          />
        )}
      </div>
    </>
  );
};

export default Vereine;

function initVerein(setVerein) {
  setVerein([
    {
      verein_name: " ",
      verein_kurz: " ",
      verein_strasse: " ",
      verein_plz: " ",
      verein_ort: " ",
      verein_telefon_privat: " ",
      verein_kz: " ",
      verein_konto_nummer: " ",
      verein_blz: " ",
      verein_bankname: " ",
      verein_konto_inhaber: " ",
      verein_ki_anschrift: " ",
      verein_iban: " ",
      verein_bic: " ",
    },
  ]);
}
